import React from "react";
import ArrowForwardIcon from '@material-ui/icons/ArrowForward';
import { Form, Input, Space, Select, TimePicker, Row, Col, Tag, InputNumber } from 'antd';
import Card from "components/Card/Card.js";
import CardBody from "components/Card/CardBody.js";
import CardHeader from "components/Card/CardHeader.js";
import CardFooter from "components/Card/CardFooter.js";
import GoogleLogin from "components/GoogleLogin"
import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles(styles);


function LogInCard(props) {

    const classes = useStyles();


    const onFinish = values => {
        console.log(values);
      };

return (


<Form layout="vertical" name="dynamic_form_nest_item" onFinish={onFinish}>
                  <CardHeader color="primary" className={classes.cardHeader}>
                    <h4 className="blanco">Crea tu perfil</h4>

                  </CardHeader>

                  <div className={classes.socialLine}>
                    <GoogleLogin />
                  </div>

                  <CardBody>
                    <Form.Item
                      label="Tipo de preparación"
                      name="nombre"
                      rules={[{
                        required: requerido,
                        message: 'Please input your Tipo de preparación!',
                      },]}
                    >
                      <Input defaultValue={props.global.nombre} placeholder="Tipo de preparación" />
                    </Form.Item>

                    <Form.Item
                      label="Tipo de preparación"
                      name="apellido"
                      rules={[{
                        required: requerido,
                        message: 'Please input your Tipo de preparación!',
                      },]}
                    >
                      <Input defaultValue={props.global.apellidos} placeholder="Tipo de preparación" />
                    </Form.Item>


                    <Form.Item
                      defaultValue={props.global.email}
                      name="email"
                      label="E-mail"
                      rules={[
                        {
                          type: 'email',
                          message: 'The input is not valid E-mail!',
                        },
                        {
                          required: requerido,
                          message: 'Please input your E-mail!',
                        },
                      ]}
                    >
                      <Input defaultValue={props.global.email} />
                    </Form.Item>

                    <Form.Item
                      name="password"
                      label="Password"
                      rules={[
                        {
                          required: requerido,
                          message: 'Please input your password!',
                        },
                      ]}
                      hasFeedback
                    >
                      <Input.Password />
                    </Form.Item>

                    <Form.Item
                      name="confirm"
                      label="Confirm Password"
                      dependencies={['password']}
                      hasFeedback
                      rules={[
                        {
                          required: requerido,
                          message: 'Please confirm your password!',
                        },
                        ({ getFieldValue }) => ({
                          validator(_, value) {
                            if (!value || getFieldValue('password') === value) {
                              return Promise.resolve();
                            }

                            return Promise.reject(new Error('The two passwords that you entered do not match!'));
                          },
                        }),
                      ]}
                    >
                      <Input.Password />
                    </Form.Item>


                  </CardBody>

                  <CardFooter className={classes.cardFooter}>

                    <Button simple type="submit" color="primary" size="lg">
                      Inscríbete
                    </Button>
                  </CardFooter>
                </Form>

)}
export default LogInCard;
